import img1 from "../assects/img1.jpg";
import img2 from "../assects/img2.jpg";
import img3 from "../assects/img3.jpg";
import img4 from "../assects/img4.jpg";

const Destination = () => {
    return (
        <div className="destination">
            <h1>Popular Destination</h1>
            <p>Tours give you the opportunity to see a lot within a time frame.</p>

            <div className="first-des">
                <div className="des-text">
                    <h2>Taal Volcano, Batangas</h2>
                
                    <p>In the quiet town of Eldridge, nestled between rolling hills and meandering streams, 
                        the aroma of freshly baked bread wafts through the air. As the sun sets, a sense of serenity 
                        envelops the community, casting a warm glow on cobblestone streets. Eldridge thrives on 
                        simplicity, where each day brings comfort and connection.</p>
                </div>

                <div className="image">
                    <img alt="img" src={img1}/>
                    <img alt="img" src={img2}/>
                </div>
            </div>
        </div>
    );

};

export default Destination
